import { Box } from '@material-ui/core'
import React from 'react'
import ListInput from '../Atoms/Input'
import TaskItem from '../TaskItem'

import { styles } from './WelcomeScreen'

const todoList = [{
  item: "todo",
  done: false,
  id: 329843,
},
{
  item: "todo",
  done: false,
  id: 329843,
}]

const TODOlistScreen = () => {

  return (
    <div style={styles}>
      <Box style={styles}>
        <div className="list__container">
          {
            todoList.map(item => (
              <TaskItem
                name={item.item}
                done={item.done}
                id={item.id}
              />
            ))
          }
        </div>
      </Box>
      <ListInput />
    </div>
  )
}

export default TODOlistScreen
